import React, { Component } from "react";
import PropTypes from "prop-types";
import Link from "next/link";

class Index extends Component {
  render() {
    return (
      <div>
        <Link href="/about">
          <a title="About Page">About Page</a>
        </Link>
        <p>Hello Next.js</p>
      </div>
    );
  }
}

Index.propTypes = {};

export default Index;
